Match fields of association class in a recursive structure<p>I have the following data structure of my data stored in a MongoDB collection.</p>

<p><a href="https://i.stack.imgur.com/gYPFb.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/gYPFb.png" alt="data model"></a></p>

<p>One of the data entries looks like the following:</p>

<pre><code>{
    "id": 0,
    ...
    "structure": {
        "id": 0,
        "name": "rsu2",
        "peers": [
            {
                "networkQuality": {
                    "name": "3G",
                    "latency": "200ms",
                    "bandwidth": "1000kbps"
                },
                "connectionEndpoint": {
                    "id": 1,
                    "name": "vehicle1",
                    "peers": []
                }
            },
            {
                "networkQuality": {
                    "name": "3G",
                    "latency": "200ms",
                    "bandwidth": "1000kbps"
                },
                "connectionEndpoint": {
                    "id": 2,
                    "name": "vehicle2",
                    "peers": []
                }
            }
        ]
    }
}
</code></pre>

<p>My question is: How can I retrieve the Topologies, which have networkQuality.name = '3G' for all connections between any two Nodes.<br>
This is my idea, but since I am not so experienced in MongoDB yet, I don't know exactly how to formulate it into a working query.</p>

<ul>
<li>Since it's a recursive structure, I would use a javascript function defined within the $where operator (<a href="https://stackoverflow.com/a/42361323/2205582">as done here</a>) to match networkQuality.name='3G' anywhere within the recursive structure.</li>
<li>By the approach described in the previous point, I would retrieve all topologies having at least one networkQuality.name='3G' and topologies having at least one networkQuality.name!='3G'. After doing this I have two sets. When I apply the set minus operation on those (first result - second result), I would obtain the desired result.</li>
</ul>

<p>Does anyone have an idea how to do this ?</p>

