How to remove a single Element from Array<p>I want to remove one field from every document using MongoDB driver for C#.</p>

<p>I have documents like this:</p>

<pre><code>{
  "_id": ObjectId("554e05dfc90d3d4dfcaa2aea"),
  "username": "abc",
  "someArray": [
    {
      "_id": ObjectId("554e0625a51586362c33c6df"),
      "IsReadOnly": false
    },
    {
      "_id": ObjectId("554e0625a51586362c33c6df"),
      "IsReadOnly": true
    }
  ]
} 

</code></pre>

<p>I want to remove the field "IsReadOnly" from "someArray", regardless of whether the value is true or false. </p>

<p>In MongoDB I can reach that with the following script:</p>

<pre><code>db.getCollection('Collection').find({}).forEach( function(doc) {
  var arr = doc.someArray;
  var length = arr.length;
  for (var i = 0; i &lt; length; i++) {
    delete arr[i]["IsReadOnly"];
  }
  db.getCollection('Collection').save(doc);
});
</code></pre>

<p>In C# I tried the following:</p>

<pre class="lang-cs prettyprint-override"><code>var update= Update.Pull("someArray",BsonValue.Create("IsReadOnly"));

// or: var update = Update.Unset("someArray.$[].IsReadOnly");
myDb.Collection.Update(null, update, UpdateFlags.Multi);
</code></pre>

<p>But the "IsReadOnly" wasn't deleted. How can I delete this field from every array and every document?</p>

