How to get the value of a select option, and use it to query an array, to populate another input<p>How can I use the value of a select input option, generated by a <code>forEach</code> loop, to get the value of another property in the same array object, and set it as the value of another input?</p>

<p>Sorry if that is wordy or its already been answered somewhere, but I cant find the answer and I have been banging my head all day (also this is my first question on SO, so please bear with me).</p>

<p>I have a page in a tuition scheduling app. 
After querying the database on server, I pass in an array of students to the page.
The students in the array have various properties, the ones relevant to this case are id, name and postcode.</p>

<pre><code>
students = [
    {id: 1, name: 'test1', postcode: 'AB1 1CD'},
    {id: 2, name: 'test2', postcode: 'AB2 2CD'},
    {id: 3, name: 'test3', postcode: 'AB3 3CD'}
]

</code></pre>

<p>On the scheduling page I have a form for creating a new lesson.
On the form there are 2 inputs. 
First input is a select list to choose a student from the array.
Second input is a text field for the students postcode. 
The options in the select are generated by a <code>forEach</code> loop, which loops through the array of students, displays the names, and sets the value of each option to be the students id. (I need the value to remain id)</p>

<pre><code>
&lt;select name="student" id="studentInput"&gt;
    &lt;% students.forEach(function(student){ %&gt;
        &lt;option value="&lt;%=student.id%&gt;"&gt; &lt;%=student.name%&gt; &lt;/option&gt;
    &lt;% }); %&gt;
&lt;/select&gt;

</code></pre>

<p>I also need to get the postcode from the student in the array and populate the postcode text field. This is where I am stumped.</p>

<pre><code>
&lt;input type="text" id="postcodeInput" name="postcode"&gt;

</code></pre>

<p>I used jQuery to get the id from the option when it is changed, and I can populate the postcode field with the id (as a test), which works fine. </p>

<pre><code>
&lt;script&gt;
    $(document).on("change", "#studentInput", function() {
        var idVariable = $(this).val()
        $("#postcodeInput").val(idVariable);
    });
&lt;/script&gt;

</code></pre>

<p>The above code gives me the student.id value as a string in the postcode field, whereas I need student.postcode</p>

<p>I tried the below code which sets the var <code>found</code> as the student corresponding to <code>id === 3</code> </p>

<pre><code>
&lt;% found = student.find(item =&gt; item.id === "3"); %&gt;
`
</code></pre>

<p>Which allows me to set the input value as <code>found.postcode</code></p>

<pre><code>
&lt;input type="text" id="postcodeInput" name="postcode" value="&lt;%=found.postcode%&gt;"&gt;
`
</code></pre>

<p>This gives me the postcode 'AB3 3CD' as the text field value. Perfect.</p>

<p>But this is with a hardcoded id. How do I make that bit dynamic?</p>

<p>I tried using jQuery, but I cant seem to access the array floating in the html, from within the script tags. 
Either it is not accessible, or I am missing a trick.</p>

<p>Any ideas? Thanks in advance!</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>students = [
    {id: 1, name: 'test1', postcode: 'AB1 1CD'},
    {id: 2, name: 'test2', postcode: 'AB2 2CD'},
    {id: 3, name: 'test3', postcode: 'AB3 3CD'}
];

$(document).on("change", "#studentInput", function() {
    var idVariable = $(this).val()
    $("#postcodeInput").val(idVariable);
});</code></pre>
<pre class="snippet-code-html lang-html prettyprint-override"><code>&lt;script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.3.1/jquery.min.js"&gt;&lt;/script&gt;
&lt;select name="student" id="studentInput"&gt;
    &lt;% students.forEach(function(student){ %&gt;
        &lt;option value="1"&gt; test1 &lt;/option&gt;
        &lt;option value="2"&gt; test2 &lt;/option&gt;
        &lt;option value="3"&gt; test3 &lt;/option&gt;
    &lt;% }); %&gt;
&lt;/select&gt;

&lt;input type="text" id="postcodeInput" name="postcode" value=""&gt;</code></pre>
</div>
</div>
</p>

