Find an element's highest level ancestor without having bi-directional reference<p>I'm using MongoDB to store subcategories in categories, and items in the subcategories. I'd like to retrieve the main category by an item. How can I do that in Spring Data the easiest way without having a bi-directional reference?</p>

<pre><code>class Category {    
    private String id;

    //some other attributes

    @DbRef
    List&lt;Category&gt; subCategories = new ArrayList&lt;&gt;();

    @DbRef
    List&lt;Item&gt; items = new ArrayList&lt;&gt;();
}
</code></pre>

<p>In the DB the Categories collection looks something like:</p>

<pre><code>{
    id: 1,
    subcategories: [
        2, 3   
    ]
},
{
    id: 2,
    items: [
        001
    ]
}
</code></pre>

<p>I'd like to find the category with ID 1 by providing the itemID 001 (which is an item in the Items collection), through the subcategory 2, <strong>without assuming the depth of connections</strong>. </p>

