<p>Now the issue which i am facing is: At the time of registration. If user register with <code>rajat.test@gmail.com</code> and he tries to login with <code>rajat.Test@gmail.com</code>. Then the app is giving the access to the user, which is wrong. Because at the time of registration , user gave all letters in lowercase.</p>

<p>So i only want to confirm that, How can i enable case senstivity while authenticating in passport local mongoose?</p>

<p>Below is my registration and login code</p>

<p><strong>register</strong></p>

<pre><code>const user = new User(req.body);
try {
    await User.register(user, req.body.password);
    res.status(302).json({message: MESSAGE.USER_REGISTRATION_SUCCESS}); 
} catch(err) {
      handleErrors(res, err);
}
</code></pre>

<p><strong>login</strong></p>

<pre><code>const authRes = await User.authenticate()(req.body.email, req.body.password);
if (authRes &amp;&amp; authRes.user) {
    const token = jwt.sign(authRes, config.SECRET);
    if (!authRes.user)
      res.status(400).json(authRes);
    else{
      res.status(302).json({user: authRes.user, token: `JWT ${token}`});                  
    }
} else {
     res.status(401).json({error: MESSAGE.INVALID_LOGIN_ERROR});
}
</code></pre>

